static ParsedTimeDuration unitFor(String s) {
  for (ParsedTimeDuration ptd : values()) {
    // iteration order is in decl order, so SECONDS matched last
    if (s.endsWith(ptd.suffix())) {
      return ptd;
    }
  }
  return null;
}
